Actions proceeding in the Patents Court are allocated to the multi-track (Part 63.1(3)). Attention is drawn to Part 63.8 and PD63.5 (case management). Since October 2014, claims issued in the Patents Court have received claim numbers with the prefix HP-.

Michael Burdon, Simmons \& Simmons LLP, CityPoint, One Ropemaker Street, London, EC2Y 9SS - tel 0207628 2020, Michael.Burdon@simmons-simmons.com.

2.1 Confidential Information means all information which the Discloser or its Representatives identify as confidential and discloses, or makes available, to the Recipient or its Representatives after the date of this agreement. The Confidential Information includes any information, findings, data or analysis derived from Confidential Information but excludes any information referred to in clause 2.2

2.2 Information is not Confidential Information if:

(A) it is, or becomes, generally available to the public other than as a direct or indirect result of the information being disclosed by the Recipient or its Representatives in breach of this agreement;

(B) it was available to the Recipient on a non-confidential basis prior to disclosure by the Discloser;

(C) it was, is, or becomes available to the Recipient on a non-confidential basis from a person who, to the Recipient's actual knowledge, is not under any confidentiality obligation in respect of that information;

(D) it was lawfully in the possession of the Recipient before the information was disclosed by the Discloser;

(E) it is developed by or for the Recipient independently of the information disclosed by the Discloser;

(F) the parties agree in writing that the information is not confidential; or

(G) the Court orders that the information is not confidential.

2.1 Confidential Information means all information which the Discloser or its professional advisers identify as confidential and discloses, or makes available, to the Recipient after the date of this agreement. The Confidential Information includes any information, findings, data or analysis derived from Confidential Information but excludes any information referred to in clause 2.2

2.2 Information is not Confidential Information if:

(A) it is, or becomes, generally available to the public other than as a direct or indirect result of the information being disclosed by the Recipient in breach of this agreement;

(B) it was available to the Recipient on a non-confidential basis prior to disclosure by the Discloser;

(C) it was, is, or becomes available to the Recipient on a non-confidential basis from a person who, to the Recipient's actual knowledge, is not under any confidentiality obligation in respect of that information;

(D) it was lawfully in the possession of the Recipient before the information was

disclosed by the Discloser;

(E) it is developed by or for the Recipient independently of the information disclosed by the Discloser;

(F) the parties agree in writing that the information is not confidential; or

(G) the Court orders that the information is not confidential.

The judges of the Patents Court and their clerks are set out in Annex A to this guide, together with their contact details.

Trials of cases with a technical difficulty rating of 4 or 5 will normally be heard by Meade J or Mellor J or by suitably qualified deputy High Court judges.

3.1 In return for the Discloser making Confidential Information available to the Recipient, the Recipient undertakes to the Discloser that it shall:

(A) keep the Confidential Information secret and confidential;

(B) not use or exploit the Confidential Information in any way except for the Purpose;

(C) not disclose or make available any Confidential Information in whole or in part to any person to whom the Discloser has not disclosed the Confidential Information for the Purpose, except as expressly permitted by, and in accordance with this agreement;

(D) apply the same security measures and degree of care to the Confidential Information as the Recipient applies to its own confidential information, which the Recipient warrants as providing adequate protection from unauthorised disclosure, copying or use; and

(E) ensure that its Representatives who receive the Confidential Information comply with these obligations.

